import React from 'react'
import "./Hp.css"
function Home(props) {
  console.log(props.data)
  return (
    <div>
    {props.data.map((e) => {
          return  (<div class="card">
            <p class="heading">
              {e.name}
            </p>
            {<img src={e.imageUrl}></img>}
            <p>
{e.categories}            </p>
            </div>)
        })
      }
    
    
    </div>
      
 


  )
}

export default Home
